ement with xpath \"//span[contains(text(),'Change Your Name')]\"\n      #open pop up window\n    Then I clear element with xpath \"//input[@formcontrolname='name']\"\n    And I type \"Abcdef\" into element with xpath \"//input[@formcontrolname='name']\"\n    Then I click on element with xpath \"//div[@class='mat-dialog-actions']/../..//span[contains(text(),'Change')]\"\n    Then I wait for element with xpath \"//td[contains(text(),'Abcdef')]\" to be present\n      #verify that name had been updated\n    Then element with xpath \"//td[contains(text(),'Abcdef')]\" should contain text \"Abcdef\"\n    Then element with xpath \"//h3[contains(text(),'Abcdef')]\" should contain text \"Abcdef\"\n  @regression\n  Scenario: Student change name with 2 alphabetical words\n#    Given I open url \"http://ask-int.portnov.com/#/login\"\n#    Then I type \"studentBP5@gmail.com\" into element with xpath \"//input[@formcontrolname='email']\"\n#    Then I type \"12345\" into element with xpath \"//input[@formcontrolname='password']\"\n#    And I click on element with xpath \"//span[contains(text(),'Sign In')]\"\n#      # land on Home page\n#    Then I wait for element with xpath \"//p[contains(text(),'STUDENT')]\" to be present\n#    Then element with xpath \"//p[contains(text(),'STUDENT')]\" should contain text \"STUDENT\"\n      # go to Settings page\n    And I click on element with xpath \"//h5[contains(text(),'Settings')]\"\n    Then element with xpath \"//h4[contains(text(),'Settings')]\" should be displayed\n    Then I click on element with xpath \"//span[contains(text(),'Change Your Name')]\"\n      #open pop up window\n    Then I clear element with xpath \"//input[@formcontrolname='name']\"\n    And I type \"Abcdef Abcdef\" into element with xpath \"//input[@formcontrolname='name']\"\n    Then I click on element with xpath \"//div[@class='mat-dialog-actions']/../..//span[contains(text(),'Change')]\"\n    Then I wait for element with xpath \"//td[contains(text(),'Abcdef Abcdef') "\n      And I type \"LastName\" into element with xpath \"//input[@formcontrolname='lastName']\"\n      Then I type \"1234@abracadabra.com\" into element with xpath \"//input[@formcontrolname='email']\"\n      And I type \"12345\" into element with xpath \"//input[@formcontrolname='group']\"\n      Then I type \"12345\" into element with xpath \"//input[@formcontrolname='password']\"\n      And I type \"12345\" into element with xpath \"//input[@formcontrolname='confirmPassword']\"\n      Then I click on element with xpath \"//button[@type='submit']\"\n      # Wait for Registration confirmation page to be loaded\n      Then I wait for element with xpath \"//h4[contains(text(),'You have been Registered.')]\" to be present\n      # Verification on Registration Confirmation page\n      Then element with xpath \"//h4[contains(text(),'You have been Registered.')]\" should contain text \"You have been Registered\"\n\n\n  Scenario: Incorrect First Name in Student Registration\n    Given I open url \"http://ask-int.portnov.com/#/registration\"\n    Then element with xpath \"//h4[contains(text(),'Registration')]\" should contain text \"Registration\"\n    # leave First Name text field empty\n    And I type \"LastName\" into element with xpath \"//input[@formcontrolname='lastName']\"\n    Then I type \"12345@abracadabra.com\" into element with xpath \"//input[@formcontrolname='email']\"\n    And I type \"12345\" into element with xpath \"//input[@formcontrolname='group']\"\n    Then I type \"12345\" into element with xpath \"//input[@formcontrolname='password']\"\n    And I type \"12345\" into element with xpath \"//input[@formcontrolname='confirmPassword']\"\n    Then I click on element with xpath \"//button[@type='submit']\"\n    #Verify that error message show 'This Field is required' under First Name text field\n    Then element with xpath \"//input[@placeholder='First Name']/ancestor::mat-form-field/div[1]/..//mat-error[contains(text(),'This field is required')]\" should contain text \"This field is required\"\n    And I wait for 5 sec","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/averkhovskaya/Gitrepo/BonusH20603/target/test-classes/features/predefined.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@predefined","id":"137d0d0d-d833-4b4d-8744-447cd6221b7f"}],"language":"en","keyword":"Feature","name":"Smoke steps","description":"","children":[{"scenario":{"location":{"line":5,"column":3},"tags":[{"location":{"line":4,"column":3},"name":"@predefined1","id":"b4b1ce49-bbe2-4154-86b5-e295c54bbbe3"}],"keyword":"Scenario","name":"Predefined steps for Google","description":"","steps":[{"location":{"line":6,"column":5},"keyword":"Given ","keywordType":"Context","text":"I open url \"https://google.com\"","id":"399b7526-e247-4a75-8ba7-9306d6825e1b"},{"location":{"line":7,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I should see page title as \"Google\"","id":"34a9a93a-b1d3-4a16-9008-bd874fb6995a"},{"location":{"line":8,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"element with xpath \"//*[@name='q']\" should be present","id":"048f3d56-47fe-43d7-aab7-70804e84704a"},{"location":{"line":9,"column":5},"keyword":"When ","keywordType":"Action","text":"I type \"Cucumber\" into element with xpath \"//*[@name='q']\"","id":"52e3bacc-6371-4a38-915c-b583eaec55ce"},{"location":{"line":10,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I click on element using JavaScript with xpath \"(//input[@name='btnK'])[1]\"","id":"f4988ea5-350f-4903-bdf0-bb655fc1413b"},{"location":{"line":11,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"I wait for element with xpath \"//*[@id='res']\" to be present","id":"e4401ec3-d129-4949-848d-d537efc63da5"},{"location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"element with xpath \"//*[@id='res']\" should contain text \"Cucumber\"","id":"234a8
